import React, { useState } from 'react';

import './movieInfo.css';

const MovieInfo = (props) => {
  const [disabled, setDisabled] = useState(true);
  const classNames = !isabled ? 'star' : '';
  const [star, setStar] = useState(0);

  

  const reting = async (elem) => {
    if (elem.target.value) {
      setStar(Math.round(elem.target.value));
      if (isLogin === 'user') {
        await API_MOVIES.rating({ filmId: filmId, points: elem.target.value });
      }
    }
  };
  
  return (
    <section className="movieInfo">
      <img src={props.data.image} alt="" />
      <h1>{props.data.name}</h1>
      <div className="stars">1234567890</div>
      <div className="infoBox">
        <div>
          <p className="infoName">genre</p>
          <p className="infoData">{props.data.genre}</p>
        </div>
        <div>
          <p className="infoName">ageRating</p>
          <p className="infoData">+{props.data.ageRating}</p>
        </div>
        <div>
          <p className="infoName">rating</p>
          <p className="infoData">{props.data.rating}</p>
        </div>
        <div>
          <p className="infoName">year</p>
          <p className="infoData">{props.data.year}</p>
        </div>
      </div>
      <div className="description">
        <h2 className="infoName">Description:</h2>
        <div>
          <p className="infoData">{props.data.description}</p>
        </div>
      </div>
      
      <div className="ratingBox">
              <form onClick={reting} name="formReting" className={'rating'}>
                <input
                  type="radio"
                  id="star-5"
                  name="rating"
                  defaultChecked={star === 5}
                  value="5"
                  disabled={disabled}
                />
                <label className={classNames} htmlFor={'star-5'}></label>
                <input
                  type="radio"
                  id="star-4"
                  name="rating"
                  defaultChecked={star === 4}
                  value="4"
                  disabled={disabled}
                />
                <label className={classNames} htmlFor={'star-4'}></label>
                <input
                  type="radio"
                  id="star-3"
                  name="rating"
                  defaultChecked={star === 3}
                  value="3"
                  disabled={disabled}
                />
                <label className={classNames} htmlFor={'star-3'}></label>
                <input
                  type="radio"
                  id="star-2"
                  name="rating"
                  defaultChecked={star === 2}
                  value="2"
                  disabled={disabled}
                />
                <label className={classNames} htmlFor={'star-2'}></label>
                <input
                  type="radio"
                  id="star-1"
                  name="rating"
                  defaultChecked={star === 1}
                  value="1"
                  disabled={disabled}
                />
                <label className={classNames} htmlFor={'star-1'}></label>
              </form>
            </div>
    </section>
  );
};

export default MovieInfo;
